import React from 'react'
import { Link } from 'react-router-dom';
// import { GoogleLogout } from 'react-google-login';
import { useNavigate } from 'react-router';


const CLIENT_ID = "1090350547929-lqosq4oc2pd2q7fnbn60tscegsdpgca6.apps.googleusercontent.com"




const Logout = () => {
    const navigate = useNavigate();

    const HandleLogout = () => {
        console.log("logout successfuly");
        navigate("/login");
    }
    return (

        <div align="center">
        <div class="card-body">
            <div className='container col-md-6 mt-4'>
            <h1>Are you sure you want to logout</h1>
            <div className='mt-4' style={{display:"flex",flexDirection:"row",justifyContent:"space-around",alignItems:"center"}}>
            <Link to="/"><button type="button" class="btn btn-dark">No take me back</button></Link>
            <Link to="/login"><button type="button" class="btn btn-danger">Yes logout</button></Link>
            <GoogleLogout clientId={CLIENT_ID} buttonText="logout" onLogoutSuccess={HandleLogout}/>
            </div>
        </div>
        </div>
        </div>
    )
}

export default Logout;
